20250110	{"-- Create users table for Discord authentication\r\nCREATE TABLE IF NOT EXISTS public.users (\r\n  id UUID PRIMARY KEY DEFAULT uuid_generate_v4(),\r\n  discord_id TEXT UNIQUE NOT NULL,\r\n  username TEXT NOT NULL,\r\n  avatar TEXT,\r\n\r\n  -- Gamification data\r\n  level INTEGER DEFAULT 1 CHECK (level >= 1 AND level <= 20),\r\n  xp INTEGER DEFAULT 0 CHECK (xp >= 0),\r\n  prestige_level INTEGER DEFAULT 0 CHECK (prestige_level >= 0),\r\n  level_path TEXT DEFAULT 'human' CHECK (level_path IN ('elf', 'human')),\r\n\r\n  -- Activity tracking\r\n  consecutive_login_days INTEGER DEFAULT 1 CHECK (consecutive_login_days >= 0),\r\n  total_unique_days INTEGER DEFAULT 1 CHECK (total_unique_days >= 0),\r\n  total_pomodoros INTEGER DEFAULT 0 CHECK (total_pomodoros >= 0),\r\n  total_study_minutes INTEGER DEFAULT 0 CHECK (total_study_minutes >= 0),\r\n\r\n  -- Settings\r\n  sound_enabled BOOLEAN DEFAULT true,\r\n  volume INTEGER DEFAULT 80 CHECK (volume >= 0 AND volume <= 100),\r\n  music_volume INTEGER DEFAULT 50 CHECK (music_volume >= 0 AND music_volume <= 100),\r\n  level_system_enabled BOOLEAN DEFAULT true,\r\n\r\n  -- Timestamps\r\n  last_login_date DATE,\r\n  last_login TIMESTAMP WITH TIME ZONE,\r\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\r\n  updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\r\n)","-- Create index on discord_id for fast lookups\r\nCREATE INDEX IF NOT EXISTS idx_users_discord_id ON public.users(discord_id)","-- Create index on last_login for activity queries\r\nCREATE INDEX IF NOT EXISTS idx_users_last_login ON public.users(last_login)","-- Enable Row Level Security\r\nALTER TABLE public.users ENABLE ROW LEVEL SECURITY","-- Create policy: Users can read their own data\r\nCREATE POLICY \\"Users can read own data\\"\r\n  ON public.users\r\n  FOR SELECT\r\n  USING (auth.uid()::text = discord_id OR true)","-- Allow read for now, can restrict later\r\n\r\n-- Create policy: Users can update their own data\r\nCREATE POLICY \\"Users can update own data\\"\r\n  ON public.users\r\n  FOR UPDATE\r\n  USING (auth.uid()::text = discord_id OR true)","-- Allow update for now, can restrict later\r\n\r\n-- Create policy: System can insert new users\r\nCREATE POLICY \\"System can insert users\\"\r\n  ON public.users\r\n  FOR INSERT\r\n  WITH CHECK (true)","-- Allow insert for now, can restrict later\r\n\r\n-- Create function to auto-update updated_at timestamp\r\nCREATE OR REPLACE FUNCTION public.update_updated_at_column()\r\nRETURNS TRIGGER AS $$\r\nBEGIN\r\n  NEW.updated_at = NOW();\r\n  RETURN NEW;\r\nEND;\r\n$$ LANGUAGE plpgsql","-- Create trigger to auto-update updated_at\r\nCREATE TRIGGER update_users_updated_at\r\n  BEFORE UPDATE ON public.users\r\n  FOR EACH ROW\r\n  EXECUTE FUNCTION public.update_updated_at_column()","-- Create completed_pomodoros table for session history\r\nCREATE TABLE IF NOT EXISTS public.completed_pomodoros (\r\n  id UUID PRIMARY KEY DEFAULT uuid_generate_v4(),\r\n  user_id UUID NOT NULL REFERENCES public.users(id) ON DELETE CASCADE,\r\n  discord_id TEXT NOT NULL,\r\n\r\n  -- Session data\r\n  duration_minutes INTEGER NOT NULL CHECK (duration_minutes > 0),\r\n  xp_earned INTEGER NOT NULL DEFAULT 0,\r\n  task_name TEXT,\r\n  notes TEXT,\r\n\r\n  -- Timestamps\r\n  completed_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\r\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\r\n)","-- Create index on user_id for user queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_user_id\r\n  ON public.completed_pomodoros(user_id)","-- Create index on discord_id for Discord-based queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_discord_id\r\n  ON public.completed_pomodoros(discord_id)","-- Create index on completed_at for time-based queries\r\nCREATE INDEX IF NOT EXISTS idx_completed_pomodoros_completed_at\r\n  ON public.completed_pomodoros(completed_at DESC)","-- Enable Row Level Security\r\nALTER TABLE public.completed_pomodoros ENABLE ROW LEVEL SECURITY","-- Create policy: Users can read their own pomodoros\r\nCREATE POLICY \\"Users can read own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR SELECT\r\n  USING (discord_id = auth.uid()::text OR true)","-- Create policy: Users can insert their own pomodoros\r\nCREATE POLICY \\"Users can insert own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR INSERT\r\n  WITH CHECK (true)","COMMENT ON TABLE public.users IS 'User accounts synced from Discord'","COMMENT ON TABLE public.completed_pomodoros IS 'History of completed pomodoro sessions'"}	create_users_table
20250117000000	{"-- Add pomodoro boost fields to users table\r\nALTER TABLE public.users\r\nADD COLUMN IF NOT EXISTS pomodoro_boost_active BOOLEAN DEFAULT false,\r\nADD COLUMN IF NOT EXISTS pomodoro_boost_expires_at BIGINT DEFAULT NULL","COMMENT ON COLUMN public.users.pomodoro_boost_active IS 'Whether +25% XP boost is currently active'","COMMENT ON COLUMN public.users.pomodoro_boost_expires_at IS 'Unix timestamp (milliseconds) when boost expires'"}	add_pomodoro_boost_fields
20250118000000	{"-- Migration: Add Daily Gift Tracking to Database\r\n-- Ensures daily gift claims are validated server-side and synced across devices\r\n\r\n-- ============================================================================\r\n-- 1. ADD DAILY GIFT TRACKING COLUMN\r\n-- ============================================================================\r\n\r\nALTER TABLE public.users\r\nADD COLUMN IF NOT EXISTS last_daily_gift_date TEXT","COMMENT ON COLUMN public.users.last_daily_gift_date IS 'Last date daily gift was claimed (YYYY-MM-DD format)'","-- ============================================================================\r\n-- 2. CREATE RPC FUNCTION: CLAIM DAILY GIFT (SERVER-SIDE VALIDATION)\r\n-- ============================================================================\r\n\r\nCREATE OR REPLACE FUNCTION public.claim_daily_gift(\r\n  p_user_id UUID,\r\n  p_xp_amount INTEGER,\r\n  p_activate_boost BOOLEAN DEFAULT false\r\n)\r\nRETURNS JSONB AS $$\r\nDECLARE\r\n  v_auth_user_id UUID;\r\n  v_today TEXT;\r\n  v_last_claim_date TEXT;\r\n  v_new_xp INTEGER;\r\n  v_boost_expires_at BIGINT;\r\nBEGIN\r\n  -- SECURITY: Verify authentication\r\n  IF auth.uid() IS NULL THEN\r\n    RAISE EXCEPTION 'Authentication required';\r\n  END IF;\r\n\r\n  -- Verify the user_id matches the caller's auth_user_id\r\n  SELECT auth_user_id INTO v_auth_user_id\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_auth_user_id IS NULL THEN\r\n    RAISE EXCEPTION 'User with id % not found', p_user_id;\r\n  END IF;\r\n\r\n  IF auth.uid() != v_auth_user_id THEN\r\n    RAISE EXCEPTION 'Unauthorized: Cannot claim gift for another user';\r\n  END IF;\r\n\r\n  -- Get today's date in YYYY-MM-DD format\r\n  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');\r\n\r\n  -- Check if gift was already claimed today\r\n  SELECT last_daily_gift_date INTO v_last_claim_date\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_last_claim_date = v_today THEN\r\n    -- Gift already claimed today\r\n    RETURN jsonb_build_object(\r\n      'success', false,\r\n      'message', 'Daily gift already claimed today',\r\n      'already_claimed', true\r\n    );\r\n  END IF;\r\n\r\n  -- Calculate boost expiration (24 hours from now in milliseconds)\r\n  IF p_activate_boost THEN\r\n    v_boost_expires_at := EXTRACT(EPOCH FROM NOW() + INTERVAL '24 hours') * 1000;\r\n  ELSE\r\n    v_boost_expires_at := NULL;\r\n  END IF;\r\n\r\n  -- Claim the gift: update XP and last_daily_gift_date atomically\r\n  UPDATE public.users\r\n  SET\r\n    xp = xp + p_xp_amount,\r\n    last_daily_gift_date = v_today,\r\n    pomodoro_boost_active = CASE WHEN p_activate_boost THEN true ELSE pomodoro_boost_active END,\r\n    pomodoro_boost_expires_at = CASE WHEN p_activate_boost THEN v_boost_expires_at ELSE pomodoro_boost_expires_at END,\r\n    updated_at = NOW()\r\n  WHERE id = p_user_id\r\n  RETURNING xp INTO v_new_xp;\r\n\r\n  IF NOT FOUND THEN\r\n    RAISE EXCEPTION 'Failed to update user data';\r\n  END IF;\r\n\r\n  -- Return success with new XP value\r\n  RETURN jsonb_build_object(\r\n    'success', true,\r\n    'message', 'Daily gift claimed successfully',\r\n    'xp_awarded', p_xp_amount,\r\n    'new_xp', v_new_xp,\r\n    'boost_activated', p_activate_boost,\r\n    'boost_expires_at', v_boost_expires_at\r\n  );\r\nEND;\r\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Grant execute to authenticated users\r\nGRANT EXECUTE ON FUNCTION public.claim_daily_gift(UUID, INTEGER, BOOLEAN) TO authenticated","COMMENT ON FUNCTION public.claim_daily_gift IS\r\n  'Atomically claim daily gift with server-side validation.\r\n   Prevents claiming multiple times per day and ensures consistency across devices.\r\n   Returns success status and new XP value.'","-- ============================================================================\r\n-- 3. CREATE HELPER FUNCTION: CHECK IF GIFT CAN BE CLAIMED\r\n-- ============================================================================\r\n\r\nCREATE OR REPLACE FUNCTION public.can_claim_daily_gift(\r\n  p_user_id UUID\r\n)\r\nRETURNS BOOLEAN AS $$\r\nDECLARE\r\n  v_auth_user_id UUID;\r\n  v_today TEXT;\r\n  v_last_claim_date TEXT;\r\nBEGIN\r\n  -- SECURITY: Verify authentication\r\n  IF auth.uid() IS NULL THEN\r\n    RETURN false;\r\n  END IF;\r\n\r\n  -- Verify the user_id matches the caller's auth_user_id\r\n  SELECT auth_user_id INTO v_auth_user_id\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  IF v_auth_user_id IS NULL OR auth.uid() != v_auth_user_id THEN\r\n    RETURN false;\r\n  END IF;\r\n\r\n  -- Get today's date in YYYY-MM-DD format\r\n  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');\r\n\r\n  -- Check if gift was already claimed today\r\n  SELECT last_daily_gift_date INTO v_last_claim_date\r\n  FROM public.users\r\n  WHERE id = p_user_id;\r\n\r\n  -- Can claim if never claimed before OR last claim was not today\r\n  RETURN (v_last_claim_date IS NULL OR v_last_claim_date != v_today);\r\nEND;\r\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Grant execute to authenticated users\r\nGRANT EXECUTE ON FUNCTION public.can_claim_daily_gift(UUID) TO authenticated","COMMENT ON FUNCTION public.can_claim_daily_gift IS\r\n  'Check if user can claim daily gift today.\r\n   Returns true if gift has not been claimed today, false otherwise.'"}	add_daily_gift_tracking
20251110153334	{"-- Fix Row Level Security Policies\r\n-- Remove overly permissive \\"OR true\\" clauses that bypass security\r\n\r\n-- Drop existing overly permissive policies\r\nDROP POLICY IF EXISTS \\"Users can read own data\\" ON public.users","DROP POLICY IF EXISTS \\"Users can update own data\\" ON public.users","DROP POLICY IF EXISTS \\"System can insert users\\" ON public.users","DROP POLICY IF EXISTS \\"Users can read own pomodoros\\" ON public.completed_pomodoros","DROP POLICY IF EXISTS \\"Users can insert own pomodoros\\" ON public.completed_pomodoros","-- Create secure policies for users table\r\nCREATE POLICY \\"Users can read own data\\"\r\n  ON public.users\r\n  FOR SELECT\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can update own data\\"\r\n  ON public.users\r\n  FOR UPDATE\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can insert own data\\"\r\n  ON public.users\r\n  FOR INSERT\r\n  TO authenticated\r\n  WITH CHECK (discord_id = auth.uid()::text)","-- Create secure policies for completed_pomodoros table\r\nCREATE POLICY \\"Users can read own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR SELECT\r\n  TO authenticated\r\n  USING (discord_id = auth.uid()::text)","CREATE POLICY \\"Users can insert own pomodoros\\"\r\n  ON public.completed_pomodoros\r\n  FOR INSERT\r\n  TO authenticated\r\n  WITH CHECK (discord_id = auth.uid()::text)","COMMENT ON POLICY \\"Users can read own data\\" ON public.users IS 'Users can only read their own profile data'","COMMENT ON POLICY \\"Users can update own data\\" ON public.users IS 'Users can only update their own profile data'","COMMENT ON POLICY \\"Users can insert own data\\" ON public.users IS 'Users can only insert their own profile'","COMMENT ON POLICY \\"Users can read own pomodoros\\" ON public.completed_pomodoros IS 'Users can only read their own pomodoro history'","COMMENT ON POLICY \\"Users can insert own pomodoros\\" ON public.completed_pomodoros IS 'Users can only insert their own pomodoro sessions'"}	fix_rls_policies
