-- Name: FUNCTION atomic_save_completed_pomodoro(p_user_id uuid, p_discord_id text, p_duration_minutes integer, p_xp_earned integer, p_task_name text, p_notes text, p_critical_success boolean); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.atomic_save_completed_pomodoro(p_user_id uuid, p_discord_id text, p_duration_minutes integer, p_xp_earned integer, p_task_name text, p_notes text, p_critical_success boolean) IS 'Atomically saves completed pomodoro and updates user stats.
   Supports dual authentication: Supabase Auth (web) + Discord Activity.
   Tracks critical success (p_critical_success) for human role 2x XP buff.
