-- Name: FUNCTION backfill_auth_user_id(p_discord_id text, p_auth_user_id uuid); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.backfill_auth_user_id(p_discord_id text, p_auth_user_id uuid) IS 'SECURITY DEFINER function to backfill auth_user_id for existing users. Verifies Discord ID ownership via JWT metadata before linking. Bypasses RLS with proper verification.';


--
-- Name: can_claim_daily_gift(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.can_claim_daily_gift(p_user_id uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_auth_user_id UUID;
  v_today TEXT;
  v_last_claim_date TEXT;
BEGIN
  -- SECURITY: Verify authentication
  IF auth.uid() IS NULL THEN
    RETURN false;
  END IF;

  -- Verify the user_id matches the caller's auth_user_id
  SELECT auth_user_id INTO v_auth_user_id
  FROM public.users
  WHERE id = p_user_id;

  IF v_auth_user_id IS NULL OR auth.uid() != v_auth_user_id THEN
    RETURN false;
  END IF;

  -- Get today's date in YYYY-MM-DD format
  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');

  -- Check if gift was already claimed today
  SELECT last_daily_gift_date INTO v_last_claim_date
  FROM public.users
  WHERE id = p_user_id;

  -- Can claim if never claimed before OR last claim was not today
  RETURN (v_last_claim_date IS NULL OR v_last_claim_date != v_today);
END;
$$;


