    RETURN jsonb_build_object(
      'success', true,
      'message', 'Daily gift claimed successfully',
      'xp_awarded', p_xp_amount,
      'new_xp', v_new_xp,
      'boost_activated', p_activate_boost,
      'boost_expires_at', v_boost_expires_at
    );
  END;
  $$;


--
-- Name: claim_daily_gift_discord(uuid, text, integer, boolean, integer, numeric); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.claim_daily_gift_discord(p_user_id uuid, p_discord_id text, p_xp_amount integer, p_activate_boost boolean DEFAULT false, p_boost_duration_hours integer DEFAULT 24, p_boost_multiplier numeric DEFAULT 1.25) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_today TEXT;
  v_last_claim_date TEXT;
  v_new_xp INTEGER;
  v_boost_expires_at BIGINT;
BEGIN
  -- Verify discord_id ownership
  IF NOT EXISTS (
    SELECT 1 FROM public.users
    WHERE id = p_user_id AND discord_id = p_discord_id
  ) THEN
    RAISE EXCEPTION 'Unauthorized: discord_id does not match user_id';
  END IF;

  -- Get today's date in YYYY-MM-DD format
  v_today := TO_CHAR(NOW() AT TIME ZONE 'UTC', 'YYYY-MM-DD');

  -- Check if gift was already claimed today
  SELECT last_daily_gift_date INTO v_last_claim_date
  FROM public.users
  WHERE id = p_user_id;

  IF v_last_claim_date = v_today THEN
    RETURN jsonb_build_object(
      'success', false,
      'message', 'Daily gift already claimed today',
      'already_claimed', true
    );
  END IF;

  -- Calculate boost expiration
  IF p_activate_boost THEN
    v_boost_expires_at := EXTRACT(EPOCH FROM NOW() + (p_boost_duration_hours || ' hours')::INTERVAL) * 1000;
  ELSE
    v_boost_expires_at := NULL;
  END IF;

  -- Claim the gift
  UPDATE public.users
  SET
    xp = xp + p_xp_amount,
    last_daily_gift_date = v_today,
    pomodoro_boost_active = CASE WHEN p_activate_boost THEN true ELSE pomodoro_boost_active END,
    pomodoro_boost_expires_at = CASE WHEN p_activate_boost THEN v_boost_expires_at ELSE pomodoro_boost_expires_at END,
    pomodoro_boost_multiplier = CASE WHEN p_activate_boost THEN p_boost_multiplier ELSE pomodoro_boost_multiplier END,
    updated_at = NOW()
  WHERE id = p_user_id
  RETURNING xp INTO v_new_xp;

  IF NOT FOUND THEN
    RAISE EXCEPTION 'Failed to update user data';
  END IF;

  RETURN jsonb_build_object(
    'success', true,
    'message', 'Daily gift claimed successfully',
    'xp_awarded', p_xp_amount,
    'new_xp', v_new_xp,
    'boost_activated', p_activate_boost,
    'boost_expires_at', v_boost_expires_at,
    'boost_multiplier', p_boost_multiplier
  );
END;
$$;


--
-- Name: claim_daily_gift_xp(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.claim_daily_gift_xp(p_user_id uuid) RETURNS TABLE(success boolean, xp_awarded integer, consecutive_days integer)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_today DATE := CURRENT_DATE;
  v_last_login DATE;
  v_consecutive INTEGER;
  v_xp INTEGER;
  v_new_consecutive INTEGER;
BEGIN
  -- SECURITY: Verify user owns this account
  IF NOT EXISTS (
    SELECT 1 FROM public.users
    WHERE id = p_user_id AND auth_user_id = auth.uid()
  ) THEN
    RAISE EXCEPTION 'Not authorized';
  END IF;

  -- Get current state
  SELECT last_login_date, consecutive_login_days
  INTO v_last_login, v_consecutive
  FROM public.users WHERE id = p_user_id;

  -- Already claimed today - reject
  IF v_last_login = v_today THEN
    RETURN QUERY SELECT FALSE, 0, v_consecutive;
    RETURN;
  END IF;

  -- Calculate new streak (continues on missed days, restarts after day 10)
  IF v_consecutive >= 10 THEN
    v_new_consecutive := 1;  -- Restart cycle
  ELSE
    v_new_consecutive := COALESCE(v_consecutive, 0) + 1;
  END IF;

  -- Calculate XP (100 on day 10, else 50)
  v_xp := CASE WHEN v_new_consecutive = 10 THEN 100 ELSE 50 END;

  -- Atomic update
  UPDATE public.users SET
    xp = xp + v_xp,
    last_login_date = v_today,
    consecutive_login_days = v_new_consecutive,
    total_login_days = total_login_days + 1,
    updated_at = NOW()
  WHERE id = p_user_id;

  RETURN QUERY SELECT TRUE, v_xp, v_new_consecutive;
END;
$$;


