CREATE TABLE public.users (
    id uuid DEFAULT extensions.uuid_generate_v4() NOT NULL,
    discord_id text NOT NULL,
    username text NOT NULL,
    avatar text,
    level integer DEFAULT 1,
    xp integer DEFAULT 0,
    prestige_level integer DEFAULT 0,
    level_path text DEFAULT 'human'::text,
    consecutive_login_days integer DEFAULT 1,
    total_unique_days integer DEFAULT 1,
    total_pomodoros integer DEFAULT 0,
    total_study_minutes integer DEFAULT 0,
    sound_enabled boolean DEFAULT true,
    volume integer DEFAULT 80,
    music_volume integer DEFAULT 50,
    level_system_enabled boolean DEFAULT true,
    last_login_date date,
    last_login timestamp with time zone,
    created_at timestamp with time zone DEFAULT now(),
    updated_at timestamp with time zone DEFAULT now(),
    auth_user_id uuid,
    timer_pomodoro_minutes integer DEFAULT 25,
    timer_short_break_minutes integer DEFAULT 5,
    timer_long_break_minutes integer DEFAULT 15,
    pomodoros_before_long_break integer DEFAULT 4,
    auto_start_breaks boolean DEFAULT false,
    auto_start_pomodoros boolean DEFAULT false,
    background_id text DEFAULT 'room-video'::text,
    playlist text DEFAULT 'lofi'::text,
    ambient_volumes jsonb DEFAULT '{}'::jsonb,
    last_username_change timestamp with time zone,
    total_login_days integer DEFAULT 0,
    last_pomodoro_date text,
    last_daily_gift_date text,
    first_login_date date DEFAULT CURRENT_DATE,
    pomodoro_boost_active boolean DEFAULT false,
    pomodoro_boost_expires_at bigint,
    pomodoro_boost_multiplier numeric(3,2) DEFAULT 1.25,
    discord_roles text[],
    discord_color text,
    last_dm_check timestamp with time zone,
    role public.user_role DEFAULT 'user'::public.user_role NOT NULL,
    background_mobile text,
    background_desktop text,
    CONSTRAINT users_consecutive_login_days_check CHECK ((consecutive_login_days >= 0)),
    CONSTRAINT users_level_check CHECK (((level >= 1) AND (level <= 50))),
    CONSTRAINT users_level_path_check CHECK ((level_path = ANY (ARRAY['elf'::text, 'human'::text]))),
    CONSTRAINT users_music_volume_check CHECK (((music_volume >= 0) AND (music_volume <= 100))),
    CONSTRAINT users_playlist_check CHECK ((playlist = ANY (ARRAY['lofi'::text, 'synthwave'::text]))),
    CONSTRAINT users_pomodoros_before_long_break_check CHECK (((pomodoros_before_long_break >= 1) AND (pomodoros_before_long_break <= 10))),
    CONSTRAINT users_prestige_level_check CHECK ((prestige_level >= 0)),
    CONSTRAINT users_timer_long_break_minutes_check CHECK (((timer_long_break_minutes >= 1) AND (timer_long_break_minutes <= 120))),
    CONSTRAINT users_timer_pomodoro_minutes_check CHECK (((timer_pomodoro_minutes >= 1) AND (timer_pomodoro_minutes <= 120))),
    CONSTRAINT users_timer_short_break_minutes_check CHECK (((timer_short_break_minutes >= 1) AND (timer_short_break_minutes <= 60))),
    CONSTRAINT users_total_login_days_check CHECK ((total_login_days >= 0)),
    CONSTRAINT users_total_pomodoros_check CHECK ((total_pomodoros >= 0)),
    CONSTRAINT users_total_study_minutes_check CHECK ((total_study_minutes >= 0)),
    CONSTRAINT users_total_unique_days_check CHECK ((total_unique_days >= 0)),
    CONSTRAINT users_volume_check CHECK (((volume >= 0) AND (volume <= 100))),
    CONSTRAINT users_xp_check CHECK ((xp >= 0))
);


