--
-- Name: reset_user_progress(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.reset_user_progress(p_user_id uuid) RETURNS public.users
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_updated_user public.users;
BEGIN
  -- SECURITY: Verify caller owns this user profile
  IF auth.uid() IS NULL THEN
    RAISE EXCEPTION 'Authentication required';
  END IF;

  IF NOT EXISTS (
    SELECT 1 FROM public.users
    WHERE id = p_user_id AND auth_user_id = auth.uid()
  ) THEN
    RAISE EXCEPTION 'Not authorized to reset this user';
  END IF;

  UPDATE public.users
  SET
    xp = 0,
    level = 1,
    prestige_level = 0,
    total_pomodoros = 0,
    total_study_minutes = 0,
    total_unique_days = 0,
    last_pomodoro_date = NULL,
    updated_at = NOW()
  WHERE id = p_user_id
  RETURNING * INTO v_updated_user;

  IF v_updated_user IS NULL THEN
    RAISE EXCEPTION 'User not found';
  END IF;

  RETURN v_updated_user;
END;
$$;


