-- Name: FUNCTION reset_user_progress(p_user_id uuid); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.reset_user_progress(p_user_id uuid) IS 'Resets all progress (XP, level, prestige, stats) for web users via Supabase Auth';


